import './header.css'
import BtnHeader from "../../shared/Button/BtnHeader/BtnHeader";

export function Header(){
    return(
        <header>
            <nav className="navHeader">
                <section className="navHeader__notAuthorized">
                    <BtnHeader>Расписание</BtnHeader>
                    <BtnHeader>Машины</BtnHeader>
                </section>
                
            </nav>
        </header>
    )
}
